  PageCenterContent,
  PageRight
} from '../components'

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      threadOpen: true,
    };
  }

  render() {
    console.log(data);
    return (
      <div style={styles.pageContentStyle}>
        <div id="content" style={styles.top}>
          <div id="left" style={styles.left}></div>
          <div id="right" style={styles.right}></div>
        </div>
      </div>
    );
  }
}

const styles = {
  pageContentStyle: {
    height: 'auto',
